import React from "react";
import MobileContainer from "../../components/common/MobileContainer";
import LoginForm from "components/login";

const Login = () => {
  const caption = `
    ${(<h3>안녕하세요.</h3>)}
  `;

  return (
    <MobileContainer title={"로그인"} caption={caption}>
      <LoginForm />
    </MobileContainer>
  );
};

export default Login;
